import React from "react";
import styled from "styled-components";
import "../Authentication/Login.css";
const ContactUs = () => {
  return (
    <Wrapper>
      {/*<img
        src="./Images/contactus.png"
        alt="contactus"
        className="contactusimage"
  />*/}
      <div className="login-signup-main">
        <div className="leftside">
          <h2>Have Some Questions?</h2>
          <form action="https://formspree.io/f/meqwjeyz" method="post">
            <div className="row">
              <div className="text">
                <label for="fname">First Name</label>
              </div>
              <div className="placeholder">
                <input
                  type="text"
                  id="fname"
                  name="firstname"
                  placeholder="Your First Name"
                  required
                ></input>
              </div>
            </div>
            <div className="row">
              <div className="text">
                <label for="lname">Last Name</label>
              </div>
              <div className="placeholder">
                <input
                  type="text"
                  id="lname"
                  name="lastname"
                  placeholder="Your Last Name"
                  required
                ></input>
              </div>
            </div>
            <div className="row">
              <div className="text">
                <label for="email">Your Email</label>
              </div>
              <div className="placeholder">
                <input
                  type="email"
                  id="email"
                  name="email"
                  placeholder="Your Email Here"
                  required
                ></input>
              </div>
            </div>
            <div className="row">
              <div className="text">
                <label for="message">Message</label>
              </div>
              <div className="placeholder">
                <textarea
                  id="message"
                  name="message"
                  placeholder="Write something.."
                  required
                ></textarea>
              </div>
            </div>
            <div className="secandorybuttonclass">
              <button className="secandorybutton" type="submit">
                Submit
              </button>
            </div>
          </form>
        </div>
        <div className="contactus-right-side">
          <h3>Send Message Here</h3>
          {/*
          <img
            src="./Images/facebookbutton.png"
            alt="facebookbutton"
            className="contactus-social-button"
          />

          <img
            src="./Images/whatsappbutton.png"
            alt="facebookbutton"
            className="contactus-social-button"
          />

          <img
            src="./Images/pinterestbutton.png"
            alt="facebookbutton"
            className="contactus-social-button"
          />

          <img
            src="./Images/twitterbutton.png"
            alt="facebookbutton"
            className="contactus-social-button"
/>*/}
        </div>
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.section`
color: white;
align-items: center
text-align: center;
justify-content: center;


.mainclass{
  display: grid; 
  grid-template-columns: 2fr 1fr;
  padding: 10rem;


}

h2{
  font-weight: bold;
  float: left;

}


.row{
  display: table;
  content: "";
  clear: both;
  
}

label{
  display: inline-block;
  padding: 12px 12px 12px 0;
  font-size: 16px;
}

.text {
  float: left;
  width: 30%;
  margin-top: 6px;
}

.placeholder {
  float: left;
  width: 100%;
  margin-top: 6px;
}

.container{
  padding: 20px;
}

input[type=text], input[type=email], textarea {
  width: 50vh;
  padding: 12px;
  border: 1px solid #ccc;
  border-radius: 4px;
  resize: vertical;
  color: black;
}

input[type=text]:hover{

  border-color: #BC0202;
}

input[type=email]:hover{
 
  border-color: #BC0202;
}

textarea:hover{
 
  border-color: #BC0202;
}


.contactusimage{
  height: auto;
  width: 100% ;
 
}

.contactus-right-side{
  box-shadow: 0 4px 8px 0 rgba(0,0,0,0.2);
  transition: 0.3s;
  text-align: center;
  justify-content: center;
  align-items: center;
  hight: auto;
  

  h3{

    font-weight: bold;

  }
}


.contactus-social-button{
  height: auto;
  width: 60%;
  padding: 20px;
  border-radius: 4px;
  cursor: pointer;


  
}
.contactus-right-side:hover {
  box-shadow: 0 16px 32px 0 rgba(0,0,0,0.2);
}
@media screen and (max-width: 1200px) {
  .mainclass{
    display: flex;
    flex-direction: column;
    padding: 10em;
  }
  
  .contactus-right-side{
   

  }
}
`;

export default ContactUs;
